void newPut(uint8_t in){
    int k;
    switch(in){
        case OFF:
            loadSignal(off,EESIZE);
            on = true;
        break;
        case 16:
            loadSignal(on16,EESIZE);
            on = false;
            break;
        case 17:
            loadSignal(on17,EESIZE);
            on = false;
            break;
        case 18:
            loadSignal(on18,EESIZE);
            on = false;
            break;
        case 19:
            loadSignal(on19,EESIZE);
            on = false;
            break;
        case 20:
            loadSignal(on20,EESIZE);
            on = false;
            break;
        case 21:
            loadSignal(on21,EESIZE);
            on = false;
            break;
        case 22:
            loadSignal(on22,EESIZE);
            on = false;
            break;
        case 23:
            loadSignal(on23,EESIZE);
            on = false;
            break;
        case 24:
            loadSignal(on24,EESIZE);
            on = false;
            break;
        case 25:
            loadSignal(on25,EESIZE);
            on = false;
            break;
        case 26:
            loadSignal(on26,EESIZE);
            on = false;
            break;
        case 27:
            loadSignal(on27,EESIZE);
            on = false;
            break;
        case 28:
            loadSignal(on28,EESIZE);
            on = false;
            break;
        case 29:
            loadSignal(on29,EESIZE);
            on = false;
            break;
        case 30:
            loadSignal(on30,EESIZE);
            on = false;
            break;
        case 31:
            loadSignal(on31,EESIZE);
            on = false;
            break;
        case 50:
            for(k=0;k<EESIZE;k++){
                sig1[k] = times[k];
            }
//            eeprom_busy_wait();
//            eeprom_read_block (sig1, signal2, EESIZE*2);
            on = false;
//            eeprom_busy_wait();
        break;
            
    }
    int i;
    int aux = 0;
    TCNT1 = 0;
    for(i=0;i<228;i++){
        while(sig1[i] > TCNT1);
        aux ^= 1;
        if(aux>0){
            //lo activo
            TCCR2B |= (0<<CS12) | (1<<CS11) | (0 <<CS10);
        }else{
            //lo desactivo
            TCCR2B &= ~((1<<CS12) | (1<<CS11) | (1 <<CS10));
            PORTD |= (0x80);
        }

    }
    temperatura = in;
    //lo desactivo
    TCCR2B &= ~((1<<CS12) | (1<<CS11) | (1 <<CS10));
    PORTD |= (0x80);
    
}

void loadSignal(char* sig, int size){
    int i = 0;
    for(i=0; i<size*2; i+=2){
        sig1[i/2] = pgm_read_word(&(sig[i]));
    }

}
